-- Name: get_auth(text); Type: FUNCTION; Schema: pgbouncer; Owner: -
--

CREATE FUNCTION pgbouncer.get_auth(p_usename text) RETURNS TABLE(username text, password text)
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO ''
    AS $_$
  BEGIN
      RAISE DEBUG 'PgBouncer auth request: %', p_usename;

      RETURN QUERY
      SELECT
          rolname::text,
          CASE WHEN rolvaliduntil < now()
              THEN null
              ELSE rolpassword::text
          END
      FROM pg_authid
      WHERE rolname=$1 and rolcanlogin;
  END;
  $_$;


--
-- Name: handle_new_user(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.handle_new_user() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
begin
  insert into public.profiles (id, full_name, role, personal_id, email, data)
  values (
    new.id,
    new.raw_user_meta_data->>'full_name',
    coalesce(new.raw_user_meta_data->>'role', 'aluno'),
    new.raw_user_meta_data->>'personal_id',
    new.email, -- Tentei inserir email aqui, se falhar é pq a coluna não existe
    '{}'::jsonb
  );
  return new;
exception
  when others then
    -- Se der erro (ex: coluna email não existe), tenta sem email
    begin
        insert into public.profiles (id, full_name, role, personal_id, data)
        values (
            new.id,
            new.raw_user_meta_data->>'full_name',
            coalesce(new.raw_user_meta_data->>'role', 'aluno'),
            new.raw_user_meta_data->>'personal_id',
            '{}'::jsonb
        );
    exception when others then
        -- Se ainda der erro, ignora para não bloquear o cadastro
        return new;
    end;
    return new;
end;
$$;


